import axios from "axios";

export const getUserDetails = async () => {
    const { data } = await axios.get(`https://jsonplaceholder.typicode.com/users`);
    return data;
}


export const getUserDetailsById = async (id) => {
    const { data } = await axios.get(`https://jsonplaceholder.typicode.com/users`);
    return data;
}
